import "./Auth.scss"

const Auth = ({ location }) => {
    return (
        <section className="auth">
            <div className="auth__content">
                {/* <Routes>
                    <Route exact path="/login" element={<LoginForm></LoginForm>} ></Route>
                    <Route exact path="/register" element={<RegisterForm></RegisterForm>} ></Route>
                </Routes> */}
                {pathname === "/login" && <LoginForm />}
                {pathname === "/register" && <RegisterForm />}
            </div>
        </section>
    );
};

export default Auth;
